INSERT INTO `posts` (`id`, `created_at`, `updated_at`, `kategori_id`, `postingan`) VALUES
(18, '2023-07-28 12:58:43', '2023-09-07 23:02:22', 6, '<h1><span style=\"font-size: 24pt;\">Microsoft berencana untuk memindahkan Windows ke layanan Cloud&nbsp;</span></h1>\r\n<p><span style=\"font-size: 24pt;\"><img class=\"img-fluid\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"405\" height=\"270\"></span></p>\r\n<p>S<span style=\"font-size: 14pt;\">aat ini Microsoft memiliki layanan Windows 365, yaitu sebuah layanan yang ditunjukan untuk perusahaan agar dapat menjalakan windows sepenuhnya secara cloud. Namun Microsoft juga memiliki tujuan yang sama untuk pengguna windows pada umumnya. Hal ini terungkap dari sebuah presentasi Internal Microsoft pada bulan Juni 2022 dalam persidangan FTC melawan Microsoft. Dalam presentasi itu terungkap bahwa Microsoft memiliki rencana jangka panjang untuk Windows berbasis cloud agar dapat distreaming melalui berbagai perangkat. &nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\"><img class=\"img-fluid\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" alt=\"\" width=\"584\" height=\"323\"></span></p>\r\n<p><span style=\"font-size: 14pt;\">Microsoft sedang mengintegrasikan fitur-fitur cloud secara langsung ke Windows 11,nantinya pengguna windows dapat menggunakan Windows 11 lokal mereka bersamaan dengan windows versi Cloud. Pada update windows 11 mendatang akan menyertakan fitur Windows 365 boot yang memungkinkan pengguna untuk dapat langsung masuk ke versi Windows Cloud mereka pada saat booting, bukan ke windows lokal. Semua upaya ini dilakukan Microsoft dalam upaya meningkatkan popularitas dan pengguna Windows.</span></p>');
INSERT INTO `posts` (`id`, `created_at`, `updated_at`, `kategori_id`, `postingan`) VALUES
(25, '2023-09-07 17:44:55', '2023-09-07 23:00:59', 6, '<h1 class=\"post-outer\">Tutorial Membuat Command Alias di Windows</h1>\r\n<div class=\"post-share-buttons post-share-buttons-top\">\r\n<div class=\"byline post-share-buttons goog-inline-block\">\r\n<div class=\"sharing\" aria-owns=\"sharing-popup-Blog1-byline-3893531633462541996\" data-title=\"Cara Membuat commad alias di Windows\">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div id=\"post-body-3893531633462541996\" class=\"post-body entry-content float-container\">\r\n<p><img class=\"img-fluid\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" alt=\"\" width=\"547\" height=\"410\"></p>\r\n<span style=\"font-size: 14pt;\">Command alias memudahkan kita menjalankan perintah cmd yang panjang hanya dengan mengetikan shortcut nya saja</span>\r\n<p><span style=\"font-size: 14pt;\">Berikut cara membuat command alias di Windows&nbsp;</span></p>\r\n<h4><span style=\"font-size: 14pt;\">1. Menggunakan doskey. contoh jika kita ingin menjalankan notepad dengan command singkat</span></h4>\r\n<div><span style=\"font-size: 14pt;\">doskey note = \"C:\\Windows\\System32\\notepad.exe\"</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-size: 14pt;\">sekarang coba ketik \"note\" di cmd dan note akan terbuka</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-size: 14pt;\">jika ingin menjalankan 2 command atau lebih gunakan \"$t\" sebagai pemisah antar command contoh:</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-size: 14pt;\">doskey note = \"C:\\Windows\\System32\\notepad.exe $t cd Download\"&nbsp; &nbsp;</span></div>\r\n<div><span style=\"font-size: 14pt;\">(perintah untuk menjalankan notepad dan pindah ke directory Download)</span></div>\r\n<div><span class=\"hljs-string\" style=\"font-size: 14pt;\" data-darkreader-inline-border-bottom=\"\" data-darkreader-inline-border-left=\"\" data-darkreader-inline-border-right=\"\" data-darkreader-inline-border-top=\"\" data-darkreader-inline-color=\"\">&nbsp;</span></div>\r\n<div><span style=\"font-size: 14pt;\">Perintah alias tersebut hanya akan dijalankan pada saat sesi cmd tersebut. jika kamu men close dan open cmd kembali. setting alias tersebut akan hilang. Untuk membuat alias tersebut menjadi permanen ikuti cara berikut:</span></div>\r\n<div>&nbsp;</div>\r\n<h4><span style=\"font-size: 14pt;\">1. Simpan alias tersebut menjadi file</span></h4>\r\n<div><span style=\"font-size: 14pt;\">doskey /macros &gt; %TEMP%\\doskey-macros.txt</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-size: 14pt;\">2. Lalu jalankan perintah dibawah untuk membuat alias menjadi permanen</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-size: 14pt;\">reg add \"HKCU\\Software\\Microsoft\\Command Processor\" /v Autorun /d \"doskey /macrofile=\\\"%TEMP%\\doskey-macros.txt\\\"\" /f</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-size: 14pt;\">Selesai. jadi setiap kali cmd dibuka kamu dapat menggunakan alias tersebut, Sekian terima kasih telah membaca tutorial kali ini</span></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n</div>\r\n<div class=\"post-bottom\">\r\n<div class=\"post-footer float-container\">\r\n<div class=\"post-footer-line post-footer-line-1\">&nbsp;</div>\r\n</div>\r\n<div class=\"post-share-buttons post-share-buttons-bottom\">\r\n<div class=\"byline post-share-buttons goog-inline-block\">\r\n<div class=\"sharing\" aria-owns=\"sharing-popup-Blog1-byline-3893531633462541996\" data-title=\"Cara Membuat commad alias di Windows\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section id=\"comments\" class=\"comments embed\" data-num-comments=\"0\"></section>');
INSERT INTO `posts` (`id`, `created_at`, `updated_at`, `kategori_id`, `postingan`) VALUES
(28, '2023-09-07 18:09:55', '2023-09-08 02:35:13', 1, '<h1 class=\"post-title entry-title\">cara mengaktifkan \"shared folder\" virtualbox di Linux</h1>\r\n<div class=\"post-share-buttons post-share-buttons-top\">\r\n<div class=\"byline post-share-buttons goog-inline-block\">&nbsp;</div>\r\n</div>\r\n<div id=\"post-body-7182471292850327565\" class=\"post-body entry-content float-container\" style=\"text-align: left;\">\r\n<p style=\"text-align: left;\">&nbsp;<span data-darkreader-inline-bgcolor=\"\" data-darkreader-inline-color=\"\">cara mengaktifkan \"shared folder\" virtualbox agar dapat share folder antara guest machince dan host. tutor ini juga untuk drop and drag dan share clip. di tutorial ini saya menggunakan Lubuntu 22.04.</span></p>\r\n<p><span data-darkreader-inline-bgcolor=\"\" data-darkreader-inline-color=\"\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span data-darkreader-inline-bgcolor=\"\" data-darkreader-inline-color=\"\">1. jalankan virtualbox. lalu dibagian device pilih \"insert guest addition ...\"</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<div class=\"separator\" style=\"text-align: left;\"><a href=\"https://blogger.googleusercontent.com/img/b/R29vZ2xl/AVvXsEjZ3Kh41B6faP7HBnZEdB654k9ClkPOakVZqO5gC9pAD5sY3Tz9n2CM4GVtUuwKa891s8GZLbaVwNsLl5xb3m6-Yn7wTcit6EESKYfIrafSjrNGE-1m0DyA4anOWEtvrS_1eLZ5VAyMp6g_oWrIzu-6mSQqUJeiQsa5FEcEutqJA0mLtPHaTJrQiQe8/s330/Screenshot_2022-10-15_11-29-18.png\"><img src=\"https://blogger.googleusercontent.com/img/b/R29vZ2xl/AVvXsEjZ3Kh41B6faP7HBnZEdB654k9ClkPOakVZqO5gC9pAD5sY3Tz9n2CM4GVtUuwKa891s8GZLbaVwNsLl5xb3m6-Yn7wTcit6EESKYfIrafSjrNGE-1m0DyA4anOWEtvrS_1eLZ5VAyMp6g_oWrIzu-6mSQqUJeiQsa5FEcEutqJA0mLtPHaTJrQiQe8/s320/Screenshot_2022-10-15_11-29-18.png\" width=\"320\" height=\"275\" border=\"0\" data-original-height=\"284\" data-original-width=\"330\"></a></div>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<span data-darkreader-inline-bgcolor=\"\" data-darkreader-inline-color=\"\">2. setelah itu buka folder cd dan jalankan terminal di folder tersebut</span>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<div class=\"separator\" style=\"text-align: left;\"><span data-darkreader-inline-color=\"\"><a href=\"https://blogger.googleusercontent.com/img/b/R29vZ2xl/AVvXsEiO_G4PYSmFEUIUtJXxHNS05X28NBaE1uJGlkM1cyQfO79WzBSbclqnrfrrdzceHDXnDeSprh-1h5IDHeFsf7Abs_2s_rJT1anIYDOdbdgeYkuBNUi1EVUShSQg8AzcOKQt4Ri2Oi9nErIS_xdqcOcGp7EaJxNSnNgKMhEh6pj4I3ocCDmmyxXpiaJn/s792/Screenshot_2022-10-15_11-30-06.png\"><img src=\"https://blogger.googleusercontent.com/img/b/R29vZ2xl/AVvXsEiO_G4PYSmFEUIUtJXxHNS05X28NBaE1uJGlkM1cyQfO79WzBSbclqnrfrrdzceHDXnDeSprh-1h5IDHeFsf7Abs_2s_rJT1anIYDOdbdgeYkuBNUi1EVUShSQg8AzcOKQt4Ri2Oi9nErIS_xdqcOcGp7EaJxNSnNgKMhEh6pj4I3ocCDmmyxXpiaJn/s320/Screenshot_2022-10-15_11-30-06.png\" width=\"320\" height=\"228\" border=\"0\" data-original-height=\"564\" data-original-width=\"792\"></a></span></div>\r\n<div class=\"separator\" style=\"text-align: left;\">&nbsp;</div>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<div class=\"contents-2MsGLg\" style=\"text-align: left;\" data-darkreader-inline-border-bottom=\"\" data-darkreader-inline-border-left=\"\" data-darkreader-inline-border-right=\"\" data-darkreader-inline-border-top=\"\" data-darkreader-inline-outline=\"\">\r\n<div id=\"message-content-1030700653800071179\" class=\"markup-eYLPri messageContent-2t3eCI\" data-darkreader-inline-border-bottom=\"\" data-darkreader-inline-border-left=\"\" data-darkreader-inline-border-right=\"\" data-darkreader-inline-border-top=\"\" data-darkreader-inline-color=\"\" data-darkreader-inline-outline=\"\">3. jalankan command ini di terminal \"sudo sh VBoxLinuxAdditions.run\"</div>\r\n<div id=\"message-content-1030700653800071179\" class=\"markup-eYLPri messageContent-2t3eCI\" data-darkreader-inline-border-bottom=\"\" data-darkreader-inline-border-left=\"\" data-darkreader-inline-border-right=\"\" data-darkreader-inline-border-top=\